// Pobierz dane z node'a "Get organisation"
const emailTemplate = $('Get organisation').first().json.emailTemplate || '';

// Pobierz imię i nazwisko z node'a "User data" (odwrócone nazewnictwo)
const { surname = '', name = '' } = $('User data').first().json;

// Funkcja do normalizacji tekstu (małe litery, bez znaków specjalnych)
function normalize(str) {
  return str
    .normalize('NFD') // dekompozycja unicode
    .replace(/[\u0300-\u036f]/g, '') // usuwa akcenty
    .replace(/[^a-zA-Z0-9]/g, '') // usuwa znaki spoza A-Z i 0-9
    .toLowerCase(); // na małe litery
}

// Normalizuj imię i nazwisko
const normName = normalize(name);
const normSurname = normalize(surname);

// Podstaw placeholdery, jeśli występują
let email = emailTemplate;
if (email.includes('<name>')) {
  email = email.replace('<name>', normName);
}
if (email.includes('<surname>')) {
  email = email.replace('<surname>', normSurname);
}

// Zwróć wynik
return [
  {
    json: {
      email,
      originalTemplate: emailTemplate,
      name,
      surname
    }
  }
];
